description:
Helicopter Canada is a Canadian documentary film directed released in 1969 by Eugene Boyko. It was nominated for an Academy Award for Best Documentary Feature at the 39th Academy Awards.

Filmed in CinemaScope, the film was made for international distribution during the Canadian centennial. It received two awards at the Canadian Film Awards (now known as the Genies): Best Film in the General Information category and a Special Prize &quot;For providing a superbly appropriate and inspiring opportunity for Canadians to view their country in the Centennial Year.&quot;

Helicopter Canada took 18 months to produce and required Boyko to spend 540 hours aloft in a specially outfitted Alouette II helicopter.

